css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("195.113.230.246") {
body {
    background-color: white !important;
}
.art-sheet-tl, .art-sheet-tr, .art-sheet-bl,
.art-sheet-br, .art-sheet-tc, .art-sheet-bc,
.art-sheet-cl, .art-sheet-cr, .art-sheet-cc, 
.art-headerobject{
    display: none !important;
}
.art-sheet-body {
    -webkit-box-shadow:  0px 0px 10px 0px #aaa;
    -moz-box-shadow:  0px 0px 10px 0px #aaa;
    box-shadow:  0px 0px 10px 0px #aaa;
    padding: 0 !important;
    -moz-border-radius: 10px !important;
    -webkit-border-radius: 10px !important;
    border-radius: 10px !important;
    overflow: hidden !important;
    background-color: white !important;
    width: 1030px !important;
}
.art-content{
    padding: 10px !important;
    overflow: hidden !important;
}
#art-page-background-glare-image {
    position: relative !important;
    opacity: 0.2;
}
h1.art-logo-name {
    color: #222 !important;
}
.art-post-body, .art-sidebar1, .art-nav-outer{
    background-color: white !important;
}
.art-sidebar1{
    width: 180px !important;
}
.art-nav-outer{
    padding: 5px 2px !important;
}
.art-hmenu a .r, .art-hmenu a .l, .art-hmenu li a span, .art-vmenu li a span {
    background-image: none !important;
    color: black !important;
    font-size: 13px !important;

}
.art-hmenu li a:hover span, .art-vmenu li a:hover span {
    background-image: none !important;
    color: #44a !important;
}
.art-hmenu-li-separator {
    width: 5px !important;
}
.art-hmenu-separator:before {
    content: "/" !important;
    color: #444 !important;
    font-size: 16px !important;
    line-height: 28px !important;
    width: 5px  !important;
}
.art-button-wrapper *, .art-button-wrapper *, .art-button-wrapper a.art-button, .art-button-wrapper a.art-button:link, .art-button-wrapper input.art-button, .art-button-wrapper button.art-button {
    background-image: none !important;
    color: #555 !important; 
}
.art-button-wrapper {
    border: 1px solid #ccc !important;
    padding: 0 !important;
    margin: 3px !important;
}
.art-header-center{
    display: none !important;
}
.art-header{
    height: 110px !important;
    overflow: hidden;
}
.art-header-clip{
    background-color: white !important;
    background-image: url("data:image/jpeg;base64,") !important;
    height: 110px !important;
}
.art-logo{
    color: #444 !important;
}
.art-logo-name, .art-logo-text{
    display: none !important;
}
.art-footer *, .art-footer-body
{
    background-image: none !important;
    background-color: white !important;
}
.art-page-footer, .art-page-footer * {
    color: white !important;
    overflow: hidden;
    position: relative;
    left: -10000px;
}
}
